webpackJsonp([0xbe85691e2ecbb80],{"./node_modules/json-loader/index.js!./.cache/json/css-layout-display-property.json":function(n,s){n.exports={data:{markdownRemark:{html:'<h2>Display Property</h2>\n<p>The <code>display</code> property specifies the type of box used for an HTML element. There are 20 total keyword values, although only 10 are used commonly. The commonly used ones are:</p>\n<div class="gatsby-highlight">\n      <pre class="language-css"><code><span class="token selector">.none</span>           <span class="token punctuation">{</span><span class="token property">display</span><span class="token punctuation">:</span> none<span class="token punctuation">}</span>\n<span class="token selector">.block</span>          <span class="token punctuation">{</span><span class="token property">display</span><span class="token punctuation">:</span> block<span class="token punctuation">}</span>\n<span class="token selector">.inline-block</span>   <span class="token punctuation">{</span><span class="token property">display</span><span class="token punctuation">:</span> inline-block<span class="token punctuation">}</span>\n<span class="token selector">.inline</span>         <span class="token punctuation">{</span><span class="token property">display</span><span class="token punctuation">:</span> inline<span class="token punctuation">}</span>\n<span class="token selector">.flex</span>           <span class="token punctuation">{</span><span class="token property">display</span><span class="token punctuation">:</span> flex<span class="token punctuation">}</span>\n<span class="token selector">.inline-flex</span>    <span class="token punctuation">{</span><span class="token property">display</span><span class="token punctuation">:</span> inline-flex<span class="token punctuation">}</span>\n<span class="token selector">.inline-table</span>   <span class="token punctuation">{</span><span class="token property">display</span><span class="token punctuation">:</span> inline-table<span class="token punctuation">}</span>\n<span class="token selector">.table</span>          <span class="token punctuation">{</span><span class="token property">display</span><span class="token punctuation">:</span> table<span class="token punctuation">}</span>\n<span class="token selector">.inherit</span>        <span class="token punctuation">{</span><span class="token property">display</span><span class="token punctuation">:</span> inherit<span class="token punctuation">}</span>\n<span class="token selector">.initial</span>        <span class="token punctuation">{</span><span class="token property">display</span><span class="token punctuation">:</span> initial<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<p><strong>Common Examples:</strong></p>\n<div class="gatsby-highlight">\n      <pre class="language-css"><code><span class="token selector">.myBox</span> <span class="token punctuation">{</span>\n    <span class="token property">display</span><span class="token punctuation">:</span> block<span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n\n<span class="token selector">.myContainer</span> <span class="token punctuation">{</span>\n    <span class="token property">display</span><span class="token punctuation">:</span> flex<span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n\n<span class="token selector">.inlineList ul > li</span> <span class="token punctuation">{</span>\n    <span class="token property">display</span><span class="token punctuation">:</span> inline<span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<h4>More Information:</h4>\n<ul>\n<li>\n<p>Documentation and full list of keyword values: <a href="https://developer.mozilla.org/en-US/docs/Web/CSS/display">MDN</a></p>\n</li>\n<li>\n<p>The W3Schools CSS reference on the display property is available: <a href="https://www.w3schools.com/cssref/pr_class_display.asp">W3Schools</a></p>\n</li>\n<li>\n<p>CSS-TRICKS has a great reference on the display property: <a href="https://css-tricks.com/almanac/properties/d/display/">CSS-Tricks</a></p>\n</li>\n<li>\n<p>Browser Support: <a href="http://caniuse.com/#search=display">caniuse</a></p>\n</li>\n<li>\n<p>A Complete Guide to Flexbox: <a href="https://css-tricks.com/snippets/css/a-guide-to-flexbox/">CSS-Tricks</a></p>\n</li>\n</ul>',fields:{slug:"/css/layout/display-property/"},frontmatter:{title:"Display Property"}}},pathContext:{slug:"/css/layout/display-property/"}}}});
